import React from 'react';
import './EventDetails.css';
import '../HomeLayout/HomeLayout.css';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import { faPlus } from '@fortawesome/free-solid-svg-icons';

class RegisteredEvents extends React.Component {

    render() {
        return (
        <div className="container-fluid">
            <div className="container-fluid, homeContainer">
                <div className="row, homeTitle">
                    <h3><b>EVENT DETAILS<button type="button" class="btn" id="addEventBtn"><FontAwesomeIcon icon={faPlus} /></button></b></h3>        
                </div>
                <div className="row">
                    <h3>Sherlock User Study</h3>
                </div>
            </div>
        </div>
        )
    }
}

export default RegisteredEvents;
